script: |
  super -f text -I q7550.spq | sort > q7550.out

inputs:
  - name: q7550.spq
    data: |
      SELECT DISTINCT - - col1 * + 52 + ( ( - col1 ) ) * col2 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + - col1 NOT BETWEEN NULL AND + + 98;
  - name: tab0

outputs:
  - name: q7550.out
    data: |
